import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import Bin from './Bin';

const name = 'jason lau';
//const element = <h1>Hello, {name}</h1>;
function changeBinColor() {
  document.getElementById('testbin').style.borderColor = 'green';
}
function formatName(user) {
  return user.firstName + ' ' + user.lastName;
}
const user = {
  firstName: 'team',
  lastName: 'sustainLA'
};
const element = (
  <div>
    <h1>
      Hello, {formatName(user)}
    </h1>
  </div>
)

ReactDOM.render(element, document.getElementById('root'));
ReactDOM.render(<Bin />, document.getElementById('bin1'));
ReactDOM.render(<Bin />, document.getElementById('bin2'));
ReactDOM.render(<Bin />, document.getElementById('bin3'));
serviceWorker.unregister();
